clear all

% Matlab script to analyze the evolution of SARS-CoV-2 in time
% It clearly demonstartes the evolution of information that takes place since Big-Bang. 
% Based on the second law of information dynamics disclosed in
% https://aip.scitation.org/doi/10.1063/5.0100358

% SARS-CoV-2 complete genome sequences available at:
% https://www.ncbi.nlm.nih.gov/nuccore/MN908947
% https://www.ncbi.nlm.nih.gov/nuccore/LC542809
% https://www.ncbi.nlm.nih.gov/nuccore/MT956915
% https://www.ncbi.nlm.nih.gov/nuccore/OQ050422
% https://www.ncbi.nlm.nih.gov/nuccore/MW466798
% https://www.ncbi.nlm.nih.gov/nuccore/MW294011
% https://www.ncbi.nlm.nih.gov/nuccore/MW679505
% https://www.ncbi.nlm.nih.gov/nuccore/MW735975
% https://www.ncbi.nlm.nih.gov/nuccore/OK546282
% https://www.ncbi.nlm.nih.gov/nuccore/OK104651
% https://www.ncbi.nlm.nih.gov/nuccore/OL351370
% https://www.ncbi.nlm.nih.gov/nuccore/OL351371
% https://www.ncbi.nlm.nih.gov/nuccore/OL351372

% (c) Szymon Lukaszyk
% licensed under MIT License
% email: szymon@patent.pl
% History
% v1: 18.01.2023
% v2: 20.01.2023 % calculate mutations among variants in symmetric matrix nmut, where nmut(i,j) is the number of mutations between wariants i and j 

covgnm = { % SARS-CoV-2 genome sequences
'', 'MN908947', '2019-12-01', 'China'; % base sequence
'', 'LC542809', '2020-03-01', 'Japan';
'', 'MT956915', '2020-05-15', 'Spain';
'', 'OQ050422', '2020-06-11', 'Nigeria'; % new
'', 'MW466798', '2020-07-28', 'South Korea';
'', 'MW294011', '2020-10-26', 'Ecuador';
'', 'MW679505', '2021-02-15', 'USA';
'', 'MW735975', '2021-02-20', 'USA';
'', 'OK546282', '2021-04-07', 'USA';
'', 'OK104651', '2021-08-29', 'Egypt'; 
'', 'OL351371', '2021-10-22', 'Egypt';
'', 'OL351370', '2021-10-23', 'Egypt'; %new B.1.617.2
'', 'OL351372', '2021-10-23', 'Egypt'; %new AY.112
};

nmut= zeros(length(covgnm),length(covgnm)); % number of mutations

nA  = zeros(1,length(covgnm)); % number of ocurences of A(denine) in the sequence
nC  = zeros(1,length(covgnm)); % number of ocurences of C(ytosine) in the sequence
nG  = zeros(1,length(covgnm)); % number of ocurences of G(Guanine) in the sequence
nT  = zeros(1,length(covgnm)); % number of ocurences of T(hymine) in the sequence

pA  = zeros(1,length(covgnm)); % probability of occurence of A(denine) in the sequence
pC  = zeros(1,length(covgnm)); % probability of occurence of C(ytosine) in the sequence
pG  = zeros(1,length(covgnm)); % probability of occurence of G(Guanine) in the sequence
pT  = zeros(1,length(covgnm)); % probability of occurence of T(hymine) in the sequence

H   = zeros(1,length(covgnm)); % Shannon entropy of the sequence 

dat = zeros(1,length(covgnm)); % sequence collection date

for j=1:length(covgnm)
  for k=1:length(covgnm{1})
    if    covgnm{j}(k) == 'N'
      covgnm{j}(k) = covgnm{1}(k); % replace nondetermined base with the base sequence 
    end

    if    covgnm{j}(k) == 'A'
      nA(j) = nA(j)+1;
    elseif covgnm{j}(k) == 'C'
      nC(j) = nC(j)+1;  
    elseif covgnm{j}(k) == 'G'
      nG(j) = nG(j)+1;  
    elseif covgnm{j}(k) == 'T'
      nT(j) = nT(j)+1;  
    end
    
    for l=j:length(covgnm)
      if( covgnm{j}(k) ~= covgnm{l}(k) )      
        nmut(j, l) = nmut(j, l) + 1;
      end
    end
  end
  pA(j) = nA(j)/length(covgnm{1});
  pC(j) = nC(j)/length(covgnm{1});
  pG(j) = nG(j)/length(covgnm{1});
  pT(j) = nT(j)/length(covgnm{1});

  H(j)  = pA(j)*log2(1/pA(j)) + pC(j)*log2(1/pC(j)) + pG(j)*log2(1/pG(j)) + pT(j)*log2(1/pT(j));
  
  dat(j)= datenum(datestr(covgnm{j, 3})) - datenum(datestr(covgnm{1, 3}));
end

nmut

H

figure
plot(dat, H, '-rs')
xlabel('time (in days after Wuhan outbreak)')
ylabel('Shannon entropy')

figure
hold on
%for j=1:length(covgnm)
%  plot(dat, nmut(j,:), '-gs')
%end
plot(dat, nmut(1,:), '-gs')

xlabel('time (in days after Wuhan outbreak)')
ylabel('Number of mutations')

return

